import React from 'react';
import { StyledDigitButton } from './DigitButton.style';

const LottoButton = (props) => {
  const { title, ...rest } = props;

  return <StyledDigitButton {...rest}>{title}</StyledDigitButton>;
};

export default LottoButton;
